DROP DATABASE licenta_db;

CREATE DATABASE licenta_db;
use licenta_db;


CREATE TABLE company_table (
id_company INTEGER NOT NULL AUTO_INCREMENT,
image LONGTEXT,
description VARCHAR(255),
email VARCHAR(250),
address VARCHAR(255),
category enum('other','IT','marketing'),
name VARCHAR(255),
PRIMARY KEY (id_company)
);


CREATE TABLE user_table (
id_user INTEGER NOT NULL AUTO_INCREMENT,
username VARCHAR(255) UNIQUE,
password VARCHAR(255),
email VARCHAR(255) UNIQUE,
type_user ENUM ('admin','company','normal'),
id_company INTEGER,
PRIMARY KEY (id_user),
CONSTRAINT company_fk Foreign key (id_company) references company_table(id_company)
);


CREATE TABLE notification_table(
id_notification INTEGER NOT NULL AUTO_INCREMENT,
message VARCHAR(255),
username_to INTEGER NOT NULL,
username_from VARCHAR(255),
message_read boolean,
PRIMARY KEY (id_notification)
);


